import React, { Fragment } from "react";

import CollectionPreview from '../CollectionPreview/CollectionPreview';

import SHOP_DATA from "../../Redux/shop/ShopData";

import { selectShopCollections } from '../../Redux/shop/shopSelector';
import { createStructuredSelector } from 'reselect';
import { connect } from 'react-redux';

const CollectionOverview = () => {
  return(
    <Fragment>
      <h1 className='shop-page-title'></h1>
      {
        SHOP_DATA.map(({ id,title, ...collectionProps}) => {
          return(
            <h1>{title}</h1>
          )
        })
      }
    </Fragment>
  )
}
  
// const mapStatetoProps = createStructuredSelector({
//   collections: selectShopCollections
// }) 

export default connect()(CollectionOverview);
